import React from 'react';
import VideoPlayer from 'react-video-js-player';
import './VideoPage.css'; // You can add specific styles for the video page here

export default function VideoPage() {
  const videoSrc = "C:\Users\priya\Desktop\New folder (2)\task\public\Enrique Iglesias - I Like It.mp4"; // Replace with the actual path to your video file

  return (
    <div className="video-container">
      <h1>Introduction to Cyber Safety</h1>
      <VideoPlayer
        src={videoSrc}
        width="720"
        height="420"
        controls={true}
      />
      <div className="video-footer">
        <button className="back-button" onClick={() => window.history.back()}>Back</button>
      </div>
    </div>
  );
}
